import React,{Component} from 'react';

class detail extends Component{

    constructor(){
        super()
        this.state={
            id:0
        }
    }

    componentDidMount(){
        let params = this.props.match.params.id
        console.log(params[0])
        this.setState({id:1})
    }
    render(){
        return(<h1>Ini detail dengan id : {this.state.id}</h1>);
    }
}

export default detail;
